import React from "react";
import CardItem from "../components/CardItem";

import sushi from "../assets/sushi.jpg";

import "./style.css";

const Main = () => {
  const dataCard = [
    {
      id: "01",
      title: "Красный дракон",
      weight: 300,
      price: 270,
      type: "Фирменные роллы",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "02",
      title: "Осака",
      weight: 250,
      price: 130,
      type: "Классические роллы",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "03",
      title: "Филадельфия",
      weight: 290,
      price: 320,
      type: "Филадельфия",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "04",
      title: "Сакура",
      weight: 265,
      price: 190,
      type: "Сэты",
      hot: false,
      count: 1,
      image: sushi,
    },

    {
      id: "05",
      title: "Черный дракон",
      weight: 280,
      price: 310,
      type: "Фирменные роллы",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "06",
      title: "Кимуро суши",
      weight: 250,
      price: 130,
      type: "Классические роллы",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "07",
      title: "Унаги маки",
      weight: 290,
      price: 320,
      type: "Филадельфия",
      hot: true,
      count: 1,
      image: sushi,
    },
    {
      id: "08",
      title: "Якудза",
      weight: 265,
      price: 190,
      type: "Сэты",
      hot: false,
      count: 1,
      image: sushi,
    },
  ];

  return (
    <div>
      <h1>Products</h1>

      <div className="cards">
        {dataCard.map((elem) => (
          <CardItem elem={elem} key={elem.id} />
        ))}
      </div>
    </div>
  );
};

export default Main;
